extension AccessTypeUtils on AccessType {
  AccessType get next {
    final index = (this.index + 1) % AccessType.values.length;
    return AccessType.values[index];
  }

  AccessType get previous {
    final index =
        (this.index - 1 + AccessType.values.length) % AccessType.values.length;
    return AccessType.values[index];
  }

  String trFromSection(String section) {
    return '${this.friendlyName}||$section.${this.name}'.tr();
  }

  String get friendlyName {
    return this
        .name
        .toSnakeCase()
        .split('_')
        .map((e) => e.capitalize())
        .join(' ');
  }
}
